    /**
     * KMP 匹配算法
     *
     * @param str1 源字符串
     * @param str2 子串
     * @return 返回匹配的第一个位置，-1 代表不匹配
     */

    public static int kmpSearch(String str1, String str2) {
        return kmpSearch(str1, str2, kmpNext(str2));
    }

    /**
     * KMP 匹配算法
     *
     * @param str1 源字符串
     * @param str2 子串
     * @param next 部分匹配表
     * @return 返回匹配的第一个位置，-1 代表不匹配
     */
    private static int kmpSearch(String str1, String str2, int[] next) {
        char[] s1 = str1.toCharArray();
        char[] s2 = str2.toCharArray();

        int s1Len = s1.length;
        int s2Len = s2.length;

        for (int i = 0, j = 0; i < s1Len; i++) {
            while (j > 0 && s1[i] != s2[j]) {
                // kmp 算法核心点，往前回溯，匹配
                j = next[j - 1];
            }
            if (s1[i] == s2[j]) {
                j++;
            }

            if (j == s2Len) {
                return i - j + 1;
            }

        }
        return -1;
    }

    /**
     * 获取部分匹配值表
     *
     * @return 部分匹配值表
     */
    public static int[] kmpNext(String dest) {
        int len = dest.length();
        int[] next = new int[len];
//        next[0] = 0;
        for (int i = 1, j = 0; i < len; i++) {
            while (j > 0 && dest.charAt(i) != dest.charAt(j)) {
                // kmp 算法核心点，往前回溯，匹配
                j = next[j - 1];
            }
            if (dest.charAt(i) == dest.charAt(j)) {
                // 前缀后缀对应相等
                j++;
            }
            next[i] = j;
        }

        return next;

    }


